    //ADD ENCOUNTER COORDINATES TO ENCOUNTER LIST
    void addEncounter(int h, int w) {
        if (numEncounters < 100)
        {
            encounters[numEncounters, 0] = h;
            encounters[numEncounters, 1] = w;
            numEncounters++;
        }
    }

    //PLACING ENCOUNTERS, YO
    void placeEncounters() {
        for (int i = 0; i < totEncounters; i++)
        {
            int r = Random.Range(0, numEncounters);
            while (encounters[r, 0] == '0')
            {
                r = Random.Range(0, numEncounters);
            }
            actualEncounters[i, 0] = encounters[r, 0];
            actualEncounters[i, 1] = encounters[r, 1];
            encounters[r, 0] = '0';
        }
    }

    //PLACE PRETTY BUILDINGS
    void placeBuilding(int w, int h) {
        int r = Random.Range(50, 58);
        char c = (char)r;
        gridKey[h, w] = c;
    } 

    //THIS CONVERTS THE CHARACTER ARRAY TO AN ARRAY OF TILE OBJECTS IT ALSO ADDS ENCOUNTERS

    GameObject GetRandomTile(string type)
    {
        if (type == "floor")
        {
            return floor;
        }
        else if (type == "wall")
        {
            return wall;
        }
        else if (type == "door")
        {
            return floor;
        }
        else if (type == "obstruction")
        {
            return wall;
        }
        else
        {
            return wall;
        }
    }

    void GenerateGridFromKey(char[,] key)
    {
        //g = ground
        //w = wall
        //c = center

        //Debugging
        if (debugging)
        {
            for (int h = 0; h < gridSize; h++)
            {
                string ans = "";
                for (int w = 0; w < gridSize; w++)
                {
                    ans += gridKey[w, h] + " ";
                }
                print(ans);
            }
        }

        //Tile Instantiation from Key
        for (int h = 0; h < gridSize; h++)
        {
            for (int w = 0; w < gridSize; w++)
            {
                GameObject currentTile = null;
                switch (gridKey[h, w]) {
                    case 'G': currentTile = casinoWall; addEncounter(h, w); break;
                    case 'g': currentTile = floor; break;
                    case 'w': currentTile = wall; break;
                    case 'v': currentTile = floor; addEncounter(h, w); break;
                    case 'c': currentTile = casinoFloor; break;
                    case 'C': currentTile = casinoWall; break;
                    case 's': currentTile = wall; addEncounter(h, w); break;
                    case 'a': currentTile = asylumFloor; break;
                    case 'A': currentTile = asylumWall; break;
                    case '1': currentTile = b1; break;
                    case '2': currentTile = b2; break;
                    case '3': currentTile = b3; break;
                    case '4': currentTile = b4; break;
                    case '5': currentTile = b5; break;
                    case '6': currentTile = b6; break;
                    case '7': currentTile = b7; break;
                    case '8': currentTile = b8; break;
                    case '0': currentTile = b1; break;
                }

                if (currentTile == floor && (h == 0 || w == 0 || h == gridSize - 1 || w == gridSize - 1)) {
                    string place = "Center";
                    GameObject newDoor = Instantiate(door, new Vector3(w, h, 0f), Quaternion.identity) as GameObject;

                    if (h == gridSize - 1) {
                        place = "Center";
                    }
                    else if (w == 0) {
                        place = "University";
                    }
                    else if (w == gridSize - 1) {
                        place = "Manor";
                    }
                }

                if (currentTile != null)
                {
                    Instantiate(currentTile, new Vector3(w, h, 0f), Quaternion.identity);
                }
            }
        }
        placeEncounters(); //PLACE ENCOUNTERS AFTER IT'S ALL GENERATED
        /*for (int i = 0; i < actualEncounters.Length; i++) {
        //INSTANTIATE ENCOUNTER HERE
        }*/
    }
